        <div class="user-wrapper">
          <div class="container-user" id="c1">
            <div class="info-user">
              <h3 class="user-title">Віктор Андрійович</h3>
              <p class="user-about">69 років</p>
              <p class="user-about">Пенсіонер</p>
              <p class="user-about">
                Захоплюється живописом, бджільництвом, гончарством,

                Дуже любить проводити час у родинному колі. Обожнює домашніх

              <p class="user-about">
                Потребує веб-додаток для пошуку втраченого домашнього улюбленця.
              </p>
